ure file?\r\n#We write our test scenarios in feature files.\r\n#We use Gherkin language in the feature files such as Feature, Scenario, Given, And, Then, When, But, Background,...\r\n#It is written in plain English\r\n#Known as non technical part. Everybody can read and understand\r\n\r\n#What is a step definition?\r\n#We write our Java code in the step definitions\r\n#This has the technical part.Only technical people can understand","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/hozde/IdeaProjects/mycucumberproject/./src/test/resources/features/firstfeaturefile.feature","feature":{"location":{"line":7,"column":1},"tags":[{"location":{"line":6,"column":1},"name":"@google_search","id":"c6bc3267-27c0-4e3b-b549-537b68aba453"}],"language":"en","keyword":"Feature","name":"Google_Search_Functionality","description":"","children":[{"background":{"location":{"line":16,"column":3},"keyword":"Background","name":"user_is_on_the_google_page","description":"","steps":[{"location":{"line":20,"column":5},"keyword":"Given ","text":"user is on the google page","id":"90a576fa-20d0-45f0-bbf0-6e1418835314"}],"id":"7caf0235-71eb-4053-9ce4-d53a469950e1"}},{"scenario":{"location":{"line":23,"column":3},"tags":[{"location":{"line":22,"column":3},"name":"@iphone_search","id":"efd5ccec-3c50-4eb1-8a35-841d0d8e210b"}],"keyword":"Scenario","name":"TC01_iphone_search","description":"","steps":[{"location":{"line":24,"column":5},"keyword":"When ","text":"user search for iPhone on google","id":"0784e8c8-6e5d-4466-86d5-16f2fa3f7d97"},{"location":{"line":25,"column":5},"keyword":"Then ","text":"verify the result has iPhone related results","id":"3d4281a2-ea58-4053-aa12-e77b1904db0b"},{"location":{"line":26,"column":5},"keyword":"Then ","text":"close the application","id":"41808c35-6ae7-4f3a-8215-efd32c6da69f"}],"examples":[],"id":"984234be-242e-4bd5-91b9-a0b0277238f3"}},{"scenario":{"location":{"line":30,"column":3},"tags":[{"location":{"line":29,"column":3
